import React, { Component } from 'react';
import './Menu.css';
import { Link } from 'react-router-dom';
class Menu extends Component {

    highlight = (e) => {
        console.log(e);
    }
    render() {
        return (
            <aside>
                <ul id="slide-out" className="sidenav sidenav-fixed">
                    <li id="logo">
                        <Link to='/' id="logo-container">
                            <img alt='logo' id="img-logo" src={process.env.PUBLIC_URL + '/img/wll.png'} />
                        </Link>
                    </li>
                    <li><Link className="option" to='/' onClick={(e) => this.highlight(e)}>Usuarios</Link></li>
                    <li><Link className="option" to='/preguntas'>Preguntas</Link></li>
                    <li><Link className="option" to='/respuestas'>Respuestas</Link></li>
                    <li><Link className="option" to='/modulos'>Modulos</Link></li>
                    <li><Link className="option" to='/subtemas'>Subtemas</Link></li>
                    <li><Link className="option" to='/tarjetas'>Tarjetas de conocimiento</Link></li>
                    <li><Link className="option" to='/tarjetasSM'>Tarjetas saber mas</Link></li>
                    <li><Link className="option" to='/preguntasT'>Preguntas trivia</Link></li>
                    <li><Link className="option" to='/respuestasT'>Respuestas trivia</Link></li>
                    <li><Link className="option" to='/recursos'>Recursos</Link></li>
                    <li><Link className="option" to='/exportar'>Exportar</Link></li>
                </ul>
            </aside>
        )
    }
}

export default Menu;
